                    "html": "\u003Cstyle\u003E\n  @font-face {\n    font-family: \"nyt-cheltenham\";\n    src: local(\"&#9786︎\"),\n      url(\"https:\u002F\u002Ftypeface.nyt.com\u002Ffonts\u002Fnyt-cheltenham-200-normal.woff\")\n        format(\"woff\");\n    font-style: normal;\n    font-weight: 200;\n  }\n  @font-face {\n    font-family: \"nyt-cheltenham\";\n    src: local(\"&#9786︎\"),\n      url(\"https:\u002F\u002Ftypeface.nyt.com\u002Ffonts\u002Fnyt-cheltenham-500-normal.woff\")\n        format(\"woff\");\n    font-style: normal;\n    font-weight: 500;\n  }\n\n  @font-face {\n    font-family: \"nyt-franklin\";\n    src: local(\"&#9786︎\"),\n      url(\"https:\u002F\u002Ftypeface.nyt.com\u002Ffonts\u002Fnyt-franklin-700-normal.woff\")\n        format(\"woff\");\n    font-style: normal;\n    font-weight: 700;\n  }\n\n\n\n  .container {\n    background: #000; \n    color: #fff;\n    padding: 20px 6% 20px;\n    margin: 20px 6% 20px;\n    display: flex;\n    justify-content: space-between;\n    align-items: center;\n  }\n\n  .promoLink {\n    color: #fff;\n    text-decoration: none;\n  }\n\n  .logger {\n    font-family: nyt-franklin, helvetica, arial, sans-serif;\n    font-size: 12px;\n    line-height: 20px;\n    font-weight: 500;\n  }\n\n  .text {\n    font-family: nyt-cheltenham, helvetica, arial, sans-serif;\n    font-size: 17px;\n    line-height: 19px;\n    font-weight: 400;\n  }\n\n  .text strong {\n    font-weight: 700;\n  }\n\n  .button {\n    display: inline-block;\n    border-radius: 3px;\n    cursor: pointer;\n    font-family: nyt-franklin, helvetica, arial, sans-serif;\n    background-color: #fff;\n    border: 1px solid #666;\n    color: #000;\n    font-size: 12px;\n    font-weight: 700;\n    letter-spacing: 1px;\n    line-height: 11px;\n    padding: 9px;\n    text-transform: uppercase;\n    margin-left: 5px;\n    white-space: nowrap;\n  }\n\u003C\u002Fstyle\u003E\n\u003Ca\n  id=\"qualtrics-link\"\n  href=\"https:\u002F\u002Fnyt.qualtrics.com\u002Fjfe\u002Fform\u002FSV_9X3Gu8gQwRIIOX3\"\n  target=\"_blank\"\n  class=\"promoLink\"\n\u003E\n  \u003Cdiv class=\"container\"\u003E\n    \u003Cdiv class=\"text\"\u003E\n      \u003Cstrong\u003EHow are we doing?\u003C\u002Fstrong\u003E\u003Cbr \u002F\u003E\n      Help us improve our app.\n    \u003C\u002Fdiv\u003E\n    \u003Cspan class=\"button\"\u003ETake Survey\u003C\u002Fspan\u003E\n  \u003C\u002Fdiv\u003E\u003C\u002Fa\n\u003E\n\u003Cscript\u003E\n  var link = document.getElementById(\"qualtrics-link\");\n\n  var check = function() {\n    if (typeof window.config === \"undefined\") {\n      window.setTimeout(check, 500);\n    } else {\n      var agentID =\n        window &&\n        window.config &&\n        window.config.userInfo &&\n        window.config.userInfo.agentID;\n\n      if (agentID && link && link.href) {\n        link.href = link.href + \"?agentID=\" + agentID;\n      }\n    }\n  };\n  check();\n\u003C\u002Fscript\u003E\n\u003Cscript\u003E\n\u002F\u002F NYT apps resize function\n    if ( window.NYTG && window.NYTG.enqueue) {\n        setTimeout(function() {\n          var container = document.querySelector(\".container\");\n          var windowWidth = window.innerWidth;\n          function resize() {\n            var height = container.offsetHeight + 20;\n            window.NYTG.enqueue(\n              JSON.stringify({ id: 0, type: 'resize', options: { height: height } })\n            )\n          }\n          window.addEventListener(\"resize\", function() {\n            if ( window.innerWidth != windowWidth ) {\n              windowWidth = window.innerWidth;\n              resize();\n            }\n          });\n          resize();\n        }, 1000);\n    }\n\u003C\u002Fscript\u003E",
